import React, { useState, useEffect } from 'react';
import axios from 'axios';
import { v4 as uuidv4 } from 'uuid';
import EmployeeForm from '../components/employeeForm';
import EmployeeList from '../components/employeeList';
import RosterPreview from '../components/rosterPreview';

const Home = () => {
  const [userId, setUserId] = useState('');
  const [employees, setEmployees] = useState([]);
  const [employeeInput, setEmployeeInput] = useState({ name: '', rank: '', battery: '', leaves: [] });
  const [startDate, setStartDate] = useState('');
  const [endDate, setEndDate] = useState('');
  const [previewData, setPreviewData] = useState(null);

  useEffect(() => {
    const today = new Date();
    const nextMonth = new Date(today);
    nextMonth.setMonth(today.getMonth() + 1);

    const format = (d) => d.toISOString().split('T')[0];

    setStartDate(format(today));
    setEndDate(format(nextMonth));
  }, []);

  useEffect(() => {
    const storedId = localStorage.getItem('userId');
    let newId = storedId;

    if (!storedId) {
      newId = uuidv4();
      localStorage.setItem('userId', newId);
    }

    setUserId(newId);

    axios.get(`http://localhost:3001/api/roster/load-draft/${newId}`)
      .then(res => {
        const { employees, startDate, endDate } = res.data;
        if (employees) setEmployees(employees);
        if (startDate) setStartDate(startDate);
        if (endDate) setEndDate(endDate);
      })
      .catch(err => console.log("No saved draft found.", err));
  }, []);

  const handleAddEmployee = () => {
    if (!employeeInput.name || !employeeInput.rank || !employeeInput.battery) return;
    setEmployees([...employees, { ...employeeInput, leaves: employeeInput.leaves || [] }]);
    setEmployeeInput({ name: '', rank: '', battery: '', leaves: [] });
  };

  const handleSaveDraft = async () => {
    try {
      await axios.post('http://localhost:3001/api/roster/save-draft', {
        userId,
        employees,
        startDate,
        endDate,
      });
      alert('Draft saved successfully!');
    } catch (err) {
      console.error(err);
      alert('Error saving draft.');
    }
  };

  const handleGenerateRoster = async () => {
    try {
      const res = await axios.post('http://localhost:3001/api/roster/generate', {
        employees,
        startDate,
        endDate,
      }, { responseType: 'blob' });

      const url = window.URL.createObjectURL(new Blob([res.data]));
      const link = document.createElement('a');
      link.href = url;
      link.setAttribute('download', 'Shift_Roster.xlsx');
      document.body.appendChild(link);
      link.click();
    } catch (err) {
      console.error(err);
      alert('Error generating roster.');
    }
  };

  const handlePreviewRoster = async () => {
    try {
      const res = await axios.post('http://localhost:3001/api/roster/preview', {
        employees,
        startDate,
        endDate,
      });
      setPreviewData(res.data);
    } catch (err) {
      console.error(err);
      alert('Error generating preview.');
    }
  };

  const handleResetForm = () => {
    setEmployees([]);
    setEmployeeInput({ name: '', rank: '', battery: '', leaves: [] });
  };

  return (
    <div className="p-4">
      <div className="hero">
        <h1>Firewatch Roster Builder</h1>
        <p>Manage and generate military duty rosters easily</p>
      </div>

      <section>
        <EmployeeForm
          employeeInput={employeeInput}
          setEmployeeInput={setEmployeeInput}
          handleAddEmployee={handleAddEmployee}
        />

        <div className="date-inputs">
          <label>Start Date: </label>
          <input type="date" value={startDate} onChange={(e) => setStartDate(e.target.value)} className="mr-4" />
          <label>End Date: </label>
          <input type="date" value={endDate} onChange={(e) => setEndDate(e.target.value)} />
        </div>

        <div className="btn-group">
          <button onClick={handleSaveDraft}>ðŸ’¾ Save Draft</button>
          <button onClick={handleGenerateRoster}>ðŸ“¥ Generate Roster</button>
          <button onClick={handlePreviewRoster}>ðŸ‘€ Preview Roster</button>
          <button onClick={handleResetForm}>ðŸ§¹ Clear Form</button>
        </div>

        <EmployeeList employees={employees} setEmployees={setEmployees} />

        {previewData && <RosterPreview data={previewData} />}
      </section>

      <footer>
        &copy; {new Date().getFullYear()} Firewatch Roster Builder - All rights reserved.
      </footer>
    </div>
  );
};

export default Home;
